import React from 'react';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Card from 'react-bootstrap/Card';
import '../components/styles/ListadoFotos.css';
import iconoNofovotiro from '../likeRed.png';


function ListadoFotos(){

    return(
   
         <Row>

             <Col md={4} lg={4} xs={12} className=" mb-4 ml-1">
                 
             <Card className="cardImg"> 
                 <Card.Body className="cardBodyImg">

                    <a className="nav-link p-0" href="#">
                        <img src="https://cdn.pixabay.com/photo/2020/02/28/15/35/bird-4887736__340.jpg" className="card-img-top"></img>
                    </a>
                    <Card.Footer className="my-0 p-1">
                        <a className="nav-link text-right p-0"  href="#">
                            <img src={iconoNofovotiro}></img>
                        </a>
                        <small className="text-muted">Titulo: Lores</small>
                        <small className="text-muted"> Autor: pixabay</small>
                        
                        </Card.Footer>

                 </Card.Body>
             </Card>
             </Col>

         </Row>
       
    );
}

export default ListadoFotos;
